import React,{NavLink} from 'react';
import Button from '@material-ui/core/Button';
import ButtonGroup from '@material-ui/core/ButtonGroup';
import { makeStyles } from '@material-ui/core/styles';

const useStyles = makeStyles((theme) => ({
  root: {
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    '& > *': {
      margin: theme.spacing(1),
    },
  },
}));

export default function BasicButtonGroup() {
  const classes = useStyles();

  return (
    <div className={classes.root}>
      <ButtonGroup variant="text" color="primary" aria-label="text primary button group" fullWidth = "true">
        <NavLink to = '/'><Button><span style={{fontFamily: "'Noto Sans JP', sans-serif",fontSize:"1rem"}}>Current Projects</span></Button></NavLink>
        <NavLink to = '/newPage'><Button><span style={{fontFamily: "'Noto Sans JP', sans-serif",fontSize:"1rem"}}>SPOC</span></Button></NavLink>
        <NavLink to = '/newPage'><Button><span style={{fontFamily: "'Noto Sans JP', sans-serif",fontSize:"1rem"}}>Imp Links</span></Button></NavLink>
        <NavLink to = '/newPage'><Button><span style={{fontFamily: "'Noto Sans JP', sans-serif",fontSize:"1rem"}}>Social Team</span></Button></NavLink>
      </ButtonGroup>
    </div>
  );
}
